#include <iostream>
#include <vector>
using namespace std;

class Solution {
    public:
        void solve(vector<vector<char> >& board) {
            if (board.empty() || board[0].empty()) {
                return;
            }
            int row = board.size(), col = board[0].size();
            cout<<"row:"<<row<<",col:"<<col<<endl;
            for (int i = 0; i < col; i++) {
                cout<<"dfs first row"<<endl;
                if (board[0][i] == 'O') {//first row
                    dfs(board, 0, i);
                }
                cout<<"dfs last row"<<endl;
                if (row > 1 && board[row - 1][i] == 'O') {//last row
                    dfs(board, row - 1, i);
                }
            }
            for (int i = 0; i < row; i++) {
                cout<<"dfs first column"<<endl;
                if (board[i][0] == 'O') {//first column
                    dfs(board, i, 0);
                }
                cout<<"dfs last column"<<endl;
                if (col > 1 && board[i][col - 1] == 'O') {//last column
                    dfs(board, i, col - 1);
                }
            }


            for (int i = 0; i < row; i++) {
                for (int j = 0; j < col; j++) {
                    if (board[i][j] == 'A') {
                        board[i][j] = 'O';
                    } else if (board[i][j] == 'O') {
                        board[i][j] = 'X';
                    }
                }
            }
        }
    private:
        void dfs(vector<vector<char> >& board, int i, int j) {
            board[i][j] = 'A';//assure [i][j] is legal
            cout<<"i:"<<i<<",j:"<<j<<endl;
            if (i > 0 && board[i - 1][j] == 'O') {
                cout<<"dfs up row, i-1:"<<(i-1)<<",j:"<<j<<endl;
                dfs(board, i - 1, j);
            }
            if (i < board.size() - 1 && board[i + 1][j] == 'O') {
                cout<<"dfs down row, i+ 1:"<<(i+1)<<",j:"<<j<<endl;
                dfs(board, i + 1, j);
            }
            if (j > 0 && board[i][j - 1] == 'O') {
                cout<<"dfs left column, i:"<<i<<",j-1:"<<(j-1)<<endl;
                dfs(board, i, j - 1);
            }
            if (j < board[0].size() - 1 && board[i][j + 1] == 'O') {
                cout<<"dfs right column, i:"<<i<<", j+1:"<<(j+1)<<endl;
                dfs(board, i, j + 1);
            }
        }
};

